  \"2013-03-15T22:34:09.385694\",\n\t\"name\": \"geothermal-favorability-map-online-interactive-map\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This map service is focused around Nevada
  Bureau of Mines and Geology Map 151 of Geothermal Favorability for the Great Basin,
  which provides a regional assessment of the potential for high-temperature (>150C)
  geothermal systems in the Great Basin that are most likely to be capable of producing
  electrical energy.  Three maps have been used to construct the favorability map:
  \ 1.  A favorability map for high-temperature amagmatic geothermal systems; 2.  A
  favorability map for high-temperature magmatically heated geothermal systems; 3.
  A geothermal information map.  The map service contains 40 separate data coverages,
  individually documented elsewhere by data category:  http://www.nbmg.unr.edu/Geothermal/Data.html.\",\n\t\"license_title\":
